CREATE TABLE TURMA(
   ANO                    INTEGER  NOT NULL
  ,NUMERO_TURMA           VARCHAR(2) NOT NULL
  ,TITULO_CURSO           VARCHAR(135) NOT NULL
  ,NUMERO_TURMAS          INTEGER  NOT NULL
  ,NUMERO_VAGAS_CURSO     INTEGER  NOT NULL
  ,NUMERO_VAGAS_TURMA     INTEGER  NOT NULL
  ,NUMERO_OCUPANTES_TURMA INTEGER  NOT NULL
  ,FOREIGN KEY (TITULO_CURSO) REFERENCES CURSO(TITULO_CURSO)
  ,PRIMARY KEY(ANO,NUMERO_TURMA,TITULO_CURSO)
);
